import React, { useEffect, useState } from 'react';
import './App.css';

export default function App() {
    const [name, setName] = useState('')

    // useEffect(() => {
    // }, [])

    const onChangeName = (event: any) => {
        setName(event.target.value)
    }

    // const Marh
    const screenSide = Math.random() > 0.5 ? 'right' : 'left';

    return (
        <div className="App">
            <div className>
                <input type="text" value={name} onChange={onChangeName} />
            </div>
            {/* Image Viewer */}
            <div className={`${screenSide}-image`}>
                <img alt="" src="/gift.png" className="image" />
            </div>
        </div>
    )
};
